import React from 'react';
import { useState } from 'react';

const List = () => {

    const [orders, setOrders] = useState([
        {
            id : 1,
            name: "Char Siu Fan",
        },

        {
            id: 2,
            name: "Siu Mai",
        },

        {
            id: 3,
            name: "Har Gao",
        }
    ])
    return (
        <div>
            {orders.map(order => (
                <h3 key={order.key}>
                    {order.name}
                </h3>
            ))}
        </div>
    )
}

export default List
